// @ts-nocheck
const METADATA = {
    website: "https://mod.io/g/shapez/u/peignenappe",
    author: "peignenappe",
    name: "Pnmod Filters",
    version: "0.3",
    id: "pnmod-filters",
    description: "Adds many filter variants.",
    minimumGameVersion: ">=1.5.0",
    modId: "2932848",
    settings: {
        enabledAtBeginning: false,
    },
};

const enumPnmodFilterVariants = {
    [shapez.defaultBuildingVariant]: "pnmod_og_l",
    pnmod_og_r: "pnmod_og_r",
    pnmod_rev_l: "pnmod_rev_l",
    pnmod_rev_r: "pnmod_rev_r",
    pnmod_thru_l: "pnmod_thru_l",
    pnmod_thru_r: "pnmod_thru_r",
    pnmod_trash: "pnmod_trash",
}


class MetaPnmodFilterBuilding extends shapez.ModMetaBuilding {
    constructor() {
        super("pnmodFilter");
    }

    static getAllVariantCombinations() {
        return [
            {
                variant: shapez.defaultBuildingVariant,
                name: "Filter",
                description: "Smaller version of the original filter, mirrored.",

                regularImageBase64: RESOURCES.sprites.filter_og_l,
                blueprintImageBase64: RESOURCES.sprites.filter_og_l,
                tutorialImageBase64: RESOURCES.sprites.filter_tuto,
            },{
                variant: enumPnmodFilterVariants.pnmod_og_r,
                name: "Filter",
                description: "Smaller version of the original filter.",

                regularImageBase64: RESOURCES.sprites.filter_og_r,
                blueprintImageBase64: RESOURCES.sprites.filter_og_r,
                tutorialImageBase64: RESOURCES.sprites.filter_tuto,
            },{
                variant: enumPnmodFilterVariants.pnmod_rev_l,
                name: "Filter (Reversed)",
                description: "Reversed filter.",

                regularImageBase64: RESOURCES.sprites.filter_rev_l,
                blueprintImageBase64: RESOURCES.sprites.filter_rev_l,
                tutorialImageBase64: RESOURCES.sprites.filter_tuto,
            },{
                variant: enumPnmodFilterVariants.pnmod_rev_r,
                name: "Filter (Reversed)",
                description: "Reversed filter.",

                regularImageBase64: RESOURCES.sprites.filter_rev_r,
                blueprintImageBase64: RESOURCES.sprites.filter_rev_r,
                tutorialImageBase64: RESOURCES.sprites.filter_tuto,
            },{
                variant: enumPnmodFilterVariants.pnmod_thru_l,
                name: "Filter (Pass-thru)",
                description: "Special filter, items coming from the right side can pass through. Overflow is ejected.",

                regularImageBase64: RESOURCES.sprites.filter_thru_l,
                blueprintImageBase64: RESOURCES.sprites.filter_thru_l,
                tutorialImageBase64: RESOURCES.sprites.filter_pt_tuto,
            },{
                variant: enumPnmodFilterVariants.pnmod_thru_r,
                name: "Filter (Pass-thru)",
                description: "Special filter, items coming from the left side can pass through. Overflow is ejected.",

                regularImageBase64: RESOURCES.sprites.filter_thru_r,
                blueprintImageBase64: RESOURCES.sprites.filter_thru_r,
                tutorialImageBase64: RESOURCES.sprites.filter_pt_tuto,
            },{
                variant: enumPnmodFilterVariants.pnmod_trash,
                name: "Filter (Trash)",
                description: "Special filter, deletes the items that don't match.",

                regularImageBase64: RESOURCES.sprites.filter_trash,
                blueprintImageBase64: RESOURCES.sprites.filter_trash,
                tutorialImageBase64: RESOURCES.sprites.filter_trash,
            },
        ];
    }

    getSilhouetteColor() {
        return "#a45aed";
    }

    getIsUnlocked(root) {
        if (METADATA.settings.enabledAtBeginning) return true;
        return root.hubGoals.isRewardUnlocked(shapez.enumHubGoalRewards.reward_wires_painter_and_levers);
    }

    getDimensions() {
        return new shapez.Vector(1, 1);
    }

    getShowWiresLayerPreview() {
        return true;
    }

    getAdditionalStatistics(root, variant) {
        if (root.gameMode.throughputDoesNotMatter()) { return []; }
        
        const beltSpeed = root.hubGoals.getBeltBaseSpeed();
        return [[shapez.T.ingame.buildingPlacement.infoTexts.speed, shapez.formatItemsPerSecond(beltSpeed)]];
    }

    setupEntityComponents(entity) {
        entity.addComponent(new shapez.WiredPinsComponent({ slots: [] }));
        entity.addComponent(new shapez.ItemAcceptorComponent({ slots: [] }));
        entity.addComponent(new shapez.ItemEjectorComponent({ slots: [] }));
        entity.addComponent(new shapez.BeltUnderlaysComponent({ underlays: [] }));
        entity.addComponent(new shapez.FilterComponent());
    }

    getAvailableVariants(root) {
        return [shapez.defaultBuildingVariant,
            enumPnmodFilterVariants.pnmod_og_r,
            enumPnmodFilterVariants.pnmod_rev_l,
            enumPnmodFilterVariants.pnmod_rev_r,
            enumPnmodFilterVariants.pnmod_thru_l,
            enumPnmodFilterVariants.pnmod_thru_r,
            enumPnmodFilterVariants.pnmod_trash,
        ];
    }

    updateVariants(entity, rotationVariant, variant) {
        entity.components.Filter.isPassThru = false;
        entity.components.Filter.isTrash = false;
        switch (variant) {
            case shapez.defaultBuildingVariant:
                // DEFAULT : OG LEFT
                entity.components.ItemEjector.setSlots([
                    { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.top },
                    { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.left },
                ]);
                entity.components.ItemAcceptor.setSlots([
                    { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.bottom },
                ]);
                entity.components.WiredPins.setSlots([
                    { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.bottom, type: shapez.enumPinSlotType.logicalAcceptor },
                ]);
                entity.components.BeltUnderlays.underlays = [
                    { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.top },
                    { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.left },
                ];
                break;
            case enumPnmodFilterVariants.pnmod_og_r:
                // OG RIGHT
                entity.components.ItemEjector.setSlots([
                    { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.top },
                    { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.right },
                ]);
                entity.components.ItemAcceptor.setSlots([
                    { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.bottom },
                ]);
                entity.components.WiredPins.setSlots([
                    { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.bottom, type: shapez.enumPinSlotType.logicalAcceptor },
                ]);
                entity.components.BeltUnderlays.underlays = [
                    { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.top },
                    { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.right },
                ];
                break;
            case enumPnmodFilterVariants.pnmod_rev_l:
                // DEFINES INSTANCE COMPONENTS FOR REVERSED LEFT
                entity.components.ItemEjector.setSlots([
                    { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.left },
                    { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.top },
                ]);
                entity.components.ItemAcceptor.setSlots([
                    { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.bottom },
                ]);
                entity.components.WiredPins.setSlots([
                    { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.bottom, type: shapez.enumPinSlotType.logicalAcceptor },
                ]);
                entity.components.BeltUnderlays.underlays = [
                    { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.left },
                    { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.top },
                ];
                break;
            case enumPnmodFilterVariants.pnmod_rev_r:
                // DEFINES INSTANCE COMPONENTS FOR REVERSED RIGHT
                entity.components.ItemEjector.setSlots([
                    { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.right },
                    { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.top },
                ]);
                entity.components.ItemAcceptor.setSlots([
                    { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.bottom },
                ]);
                entity.components.WiredPins.setSlots([
                    { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.bottom, type: shapez.enumPinSlotType.logicalAcceptor },
                ]);
                entity.components.BeltUnderlays.underlays = [
                    { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.right },
                    { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.top },
                ];
                break;
            case enumPnmodFilterVariants.pnmod_thru_l:
                // DEFINES INSTANCE COMPONENTS FOR THROUGH LEFT
                entity.components.Filter.isPassThru = true;
                entity.components.ItemEjector.setSlots([
                    { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.left },
                    { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.top },
                ]);
                entity.components.ItemAcceptor.setSlots([
                    { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.right },
                    { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.bottom },
                ]);
                entity.components.WiredPins.setSlots([
                    { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.right, type: shapez.enumPinSlotType.logicalAcceptor },
                    { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.left, type: shapez.enumPinSlotType.logicalEjector },
                ]);
                entity.components.BeltUnderlays.underlays = [
                    { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.left },
                    { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.top },
                ];
                break;
            case enumPnmodFilterVariants.pnmod_thru_r:
                // DEFINES INSTANCE COMPONENTS FOR THROUGH RIGHT
                entity.components.Filter.isPassThru = true;
                entity.components.ItemEjector.setSlots([
                    { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.right },
                    { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.top },
                ]);
                entity.components.ItemAcceptor.setSlots([
                    { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.left },
                    { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.bottom },
                ]);
                entity.components.WiredPins.setSlots([
                    { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.left, type: shapez.enumPinSlotType.logicalAcceptor },
                    { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.right, type: shapez.enumPinSlotType.logicalEjector },
                ]);
                entity.components.BeltUnderlays.underlays = [
                    { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.right },
                    { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.top },
                ];
                break;
            case enumPnmodFilterVariants.pnmod_trash:
                // DEFINES INSTANCE COMPONENTS FOR TRASH VERSION
                entity.components.Filter.isTrash = true;
                entity.components.ItemEjector.setSlots([
                    { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.top },
                    { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.top },
                ]);
                entity.components.ItemAcceptor.setSlots([
                    { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.bottom },
                ]);
                entity.components.WiredPins.setSlots([
                    { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.bottom, type: shapez.enumPinSlotType.logicalAcceptor },
                ]);
                entity.components.BeltUnderlays.underlays = [
                    { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.top },
                ];
                break;
            default:
                assert(false, "Unknown filter variant: " + variant);
        }
    }
}

class Mod extends shapez.Mod {
    init() {

        // Register the new building
        this.modInterface.registerNewBuilding({
            metaClass: MetaPnmodFilterBuilding,
            buildingIconBase64: RESOURCES.sprites.filter_icon,
        });

        // Add it to the regular toolbar
        this.modInterface.addNewBuildingToToolbar({
            toolbar: "regular",
            location: "secondary",
            metaClass: MetaPnmodFilterBuilding,
        });

        this.modInterface.addNewBuildingToToolbar({
            toolbar: "wires",
            location: "secondary",
            metaClass: MetaPnmodFilterBuilding,
        });

        // REPLACING FILTER METHODS SO ITS NEVER CLOGGED

        this.modInterface.extendClass(shapez.FilterSystem, ({ $super, $old }) => ({

            update() {
                const progress =
                    this.root.dynamicTickrate.deltaSeconds *
                    this.root.hubGoals.getBeltBaseSpeed() *
                    shapez.globalConfig.itemSpacingOnBelts;
        
                const requiredProgress = 1 - progress;
        
                for (let i = 0; i < this.allEntities.length; ++i) {
                    const entity = this.allEntities[i];
                    const filterComp = entity.components.Filter;
                    const ejectorComp = entity.components.ItemEjector;

                    if (filterComp.isPassThru) {
                        const network = entity.components.WiredPins.slots[0].linkedNetwork;
                        if (!network || !network.hasValue()) {
                            // Filter is not connected
                            entity.components.WiredPins.slots[1].value = false;
                        } else {
                            entity.components.WiredPins.slots[1].value = network.currentValue;
                        }
                    }
        
                    // Process payloads
                    const slotsAndLists = [filterComp.pendingItemsToLeaveThrough, filterComp.pendingItemsToReject];
                    for (let slotIndex = 0; slotIndex < slotsAndLists.length; ++slotIndex) {
                        const pendingItems = slotsAndLists[slotIndex];
        
                        for (let j = 0; j < pendingItems.length; ++j) {
                            const nextItem = pendingItems[j];
                            // Advance next item
                            nextItem.progress = Math.min(requiredProgress, nextItem.progress + progress);
                            // Check if it's ready to eject
                            if (nextItem.progress >= requiredProgress - 1e-5) {
                                if (ejectorComp.tryEject(slotIndex, nextItem.item)) {
                                    pendingItems.shift();
                                }
                            }
                        }
                    }
                }
            },

            tryAcceptItem(entity, slot, item) {

                const MAX_ITEMS_IN_QUEUE = 2;

                // TO WORK WITH PACKAGES MOD
                let itemValue = item;

                if (item.getItemType() === "package") { itemValue = item.item }
            
                if (entity.components.Filter.isPassThru) {
                    // PASSTHROUGH FILTER)
                    if (slot === 1) {
                        // MAIN SLOT

                        const network = entity.components.WiredPins.slots[0].linkedNetwork;
                        if (!network || !network.hasValue()) {
                            // Filter is not connected
                            entity.components.WiredPins.slots[1].value = false;
                            return false;
                        }
                        const value = network.currentValue;
                        entity.components.WiredPins.slots[1].value = value;

                        const filterComp = entity.components.Filter;
                        assert(filterComp, "entity is no filter");

                        // Figure out which list we have to check
                        let listToCheck;
                        if (value.equals(shapez.BOOL_TRUE_SINGLETON) || value.equals(itemValue)) {
                            listToCheck = filterComp.pendingItemsToLeaveThrough;
                        } else {
                            listToCheck = filterComp.pendingItemsToReject;
                        }
                        if (listToCheck.length >= MAX_ITEMS_IN_QUEUE) {
                            // Busy, can't eject, try to eject through other slot
                            listToCheck = filterComp.pendingItemsToReject;
                        }
                        if (listToCheck.length >= MAX_ITEMS_IN_QUEUE) {
                            // Other slot busy, can't eject so can't accept
                            return false;
                        }
                        // Actually accept item
                        listToCheck.push({
                            item,
                            progress: 0.0,
                        });
                        return true;
                    } else {
                        // SECONDARY SLOT

                        const filterComp = entity.components.Filter;
                        assert(filterComp, "entity is no filter");

                        if (filterComp.pendingItemsToLeaveThrough.length >= MAX_ITEMS_IN_QUEUE) { // Busy, can't eject
                            return false;
                        } else { // Everything is ok, eject through truthy slot
                            filterComp.pendingItemsToLeaveThrough.push({
                                item,
                                progress: 0.0,
                            });
                        }
                        return true;
                    }
                } else if (entity.components.Filter.isTrash) {
                    // TRASH FILTER
                    const network = entity.components.WiredPins.slots[0].linkedNetwork;
                    if (!network || !network.hasValue()) return false;

                    const value = network.currentValue;
                    const filterComp = entity.components.Filter;
                    assert(filterComp, "entity is no filter");

                    let listToCheck;
                    if (value.equals(shapez.BOOL_TRUE_SINGLETON) || value.equals(itemValue)) { listToCheck = filterComp.pendingItemsToLeaveThrough; } else { listToCheck = filterComp.pendingItemsToReject; }
                    if (listToCheck.length >= MAX_ITEMS_IN_QUEUE) return false;
                    if (listToCheck == filterComp.pendingItemsToReject) return true;
                    listToCheck.push({
                        item,
                        progress: 0.0,
                    });
                    return true;
                } else {
					return $old.tryAcceptItem.bind(this)(entity, slot, item);
				}
            },
        }));
        
    }
}

